r.x:
var $bm_rt;
var fltR = 0;
try {
    var objSP = thisComp.layer('point 4').transform.position, objEP = thisComp.layer('point 3').transform.position, intPA = thisComp.pixelAspect;
    var fltR = radiansToDegrees(Math.atan2($bm_sub(objSP[1], objEP[1]), $bm_mul($bm_sub(objSP[0], objEP[0]), intPA)));
} catch ($objE) {
}
$bm_rt = $bm_sub(fltR, 180);

s.x:
var $bm_rt;
var fltD = 100, arrF, arrT, intPA = thisComp.pixelAspect;
try {
    arrF = thisComp.layer('point 4').transform.position.value;
    arrT = thisComp.layer('point 3').transform.position.value;
    fltD = length([
        $bm_mul(arrF[0], intPA),
        arrF[1]
    ], [
        $bm_mul(arrT[0], intPA),
        arrT[1]
    ]);
} catch ($objE) {
}
$bm_rt = [
    fltD,
    100
];

